import React from "react";
import styled from "styled-components";
import { useHistory } from "react-router";


const Detail = (props) => {
    console.log(props);
    const history = useHistory();


    return ( 
       <div>
           <h3>평점남기기</h3>
            <GoWeek onClick={() => {
            history.push("/");
            }}>
                평점 남기기
            </GoWeek>
        </div>
    );
}

const GoWeek = styled.button`
    width: 100%;
    background-color: purple;
    border: none;
    border-radius: 5px;
    padding: 1rem;
    color: white;
`


export default Detail;
